    return(
        <div className="col-md-4">

        <select
          class="form-select"
          id="inputGroupSelect01"

        >
          <option value="neutro">Chosse..</option>

          <option value="female">female</option>
          <option value="male">male</option>
        </select>

      </div>
    );
}

export { Select };
